(323, 211, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:25:"Barbara Walters Fernandez";s:9:"Teléfono";s:11:"15148055567";s:5:"Email";s:29:"barbie_walters_17@hotmail.com";s:8:"Consulta";s:538:"Buenos dias,\r\nmi familia ha hecho sus tratamientos, con las pastillas de ajo y cebolla, yo vivo en canada, pero mi abuela va a venir proximamente, yo estoy informada que en su clinica po pueden recetar sin antes hacer una consulta, pero queria saber si habia alguna solucion, la verdad que he subido mucho de peso y por mas que tengo actividades fisicas como el gimnasio y soy profesora de baile, me cuesta mucho perder los kilos que he subido. no se si podriamos ver una solucion para poder hacer un tratamiento se lo agradeceria mucho, ";}'),
