(1110, 320, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:6:"Walter";s:9:"Teléfono";s:7:"6220663";s:5:"Email";s:24:"walterfuentest@gmail.com";s:8:"Consulta";s:668:"Buenas tardes, quisiera saber cuanto esta la consulta con el Dr Cuadros para el tratamiento de bajar de peso.\r\n\r\nOtra consulta, he llegado a este centro medico mediante foros que hablan bien, pero lo unico malo que he encontrado es que la mayoria habla en que tienen mal su balanza, a casi todos les han aumentado de 4 a 8 kilos de mas en el primer peso de parte de ustedes.\r\n\r\nMe gustaria saber si ya han arreglado ese desperfecto en la balanza que usan.\r\n\r\nSolo quiero aclarar que SI estoy interesado, las personas que lo recomiendan son las mismas que dicen sobre el desperfecto de la balanza, pero de que bajan de peso si bajan.\r\n\r\nMuchas gracias.\r\nWalter Fuentes.";}'),
