(1320, 341, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:26:"SARA MILAGROS PARIONA RIOS";s:9:"Teléfono";s:9:"989296029";s:5:"Email";s:25:"samipari19-10@hotmail.com";s:8:"Consulta";s:538:"Buenas tardes, soy paciente pero la ultima vez que adquiri mis pastillas me cayeron muy mal que tuve que dejar de tomarlas, me dieron nauseas, vomitos, desvaneciemitno del cuerpo, decaimiento total de mi estado de animo, todos los malestares de un embarazo, es por eso que necesito saber si debo cambiar de dosis o necesito que se me den otras y si es posible deseo una cita lo mas pronto posible para continuar con mis pastillas. La cita podría ser el lunes 30 o martes 31 de diciembre. Estaré a la expectativa de su atención. Gracias";}'),
