(1850, 394, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:6:"Hilda ";s:9:"Teléfono";s:9:"991590304";s:5:"Email";s:19:"brujhilda@gmail.com";s:8:"Consulta";s:599:"Buenas Tardes Doctor Virgilio Cuadros... La presente es para hacerle una consulta. Yo soy una chica de 27 años que sufre de obesidad mórbida y quisiera saber si Ud., podría ayudarme con el sobrepeso que tengo y de ser así, quisiera saber cuál sería el costo del tratamiento, por cuánto tiempo lo tengo que llevar y cuál sería el mejor tratamiento para mi persona... Por favor, le agradecería que me conteste a la brevedad posible, ya que realmente quisiera más que todo por salud, adelgazar. Sin más, me despido atentamente y agradezco desde ya por su gentil atención... Hasta Luego! :)";}'),
