(2550, 464, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:17:"SILVIA CONCEPCION";s:9:"Teléfono";s:9:"951729568";s:5:"Email";s:27:"xivi_concepxion@hotmail.com";s:8:"Consulta";s:737:"Bueno días:\r\nMi nombre es Silvia Concepción, estoy muy interesada en los tratamientos de pérdida de peso que ofrecen; tengo 22 años, vivo en Arequipa, un bebe de 3 meses, he dado a luz por cesárea en Abril y aumenté mucho mi peso durante el embarazo, llegando casi a los 20 kilos, aspiro bajar por lo menos diez kilos, y sería mejor llegar a mi peso original; mido 1.70, mi peso actual es de 80 kilos.\r\nEl peso anterior al embarazo fue de 60.\r\nPrevias operaciones como implantes de senos y lipo, realizada en Enero del 2013:\r\nNinguna enfermedad crónica.\r\nOcupación, estudiante.\r\nCorreo: xivi_concepxion@hotmail.com\r\nTeléfono: 951729568\r\nDirección: Urb. El Remanso E-11 Los Arces Cayma, Arequipa\r\nEspero su contacto,\r\nGracias\r\n";}'),
