(2580, 467, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:26:"Lucia Paula Tejada Delgado";s:9:"Teléfono";s:9:"969354441";s:5:"Email";s:20:"lucia.td14@gmial.com";s:8:"Consulta";s:565:"Buenos días doctor, por recomendación de una amiga que esta tratando me encantaría seguir un tratamiento con usted para bajar de peso; yo soy de Arequipa y tengo 21 años de edad.\r\nUltimamente he intentado bajar de peso pero yo tengo Hiperinsulinemia y estoy haciendo una resistencia a perder peso, tomo glucophage XR de 1000 después del dedayuno y después del almuerzo, también sufro de alergias constantes especialmente al pescado y a los cítricos.\r\nEspero recibir una respuesta y poder seguir el tratamiento con usted, muchas gracias de antemano.\r\nLucía.";}'),
