(3070, 519, '_feedback_all_fields', 'a:4:{s:6:"Nombre";s:5:"Laura";s:9:"Teléfono";s:0:"";s:5:"Email";s:24:"consulperu86@hotmail.com";s:8:"Consulta";s:485:"Buenos días tengo 28 años, peso 78 kilos y quiero bajar de peso a 60 kilos. Pero cinco kilos quiero bajarlos naturalmente, quiero decir que quiero bajarlos con ejercicios y comida sana, los otros kilos restantes quiero bajarlos con el Dr. Cuadros. Que me recomiendan, primero bajar los 5 kilos con ejercicios y luego recurrir a Dr o al revés?. Espero una pronta respuesta. Más alla si me tengo que hacer chequeos o no, quisiera saber que es lo primero que tengo que hacer. Gracias.";}'),
