(3917, 635, '_feedback_akismet_values', 'a:53:{s:14:"comment_author";s:10:"Karim Cajo";s:20:"comment_author_email";s:24:"karimerika28@hotmail.com";s:18:"comment_author_url";s:0:"";s:20:"contact_form_subject";s:22:"Un correo desde su Web";s:17:"comment_author_IP";s:15:"190.237.101.213";s:15:"comment_content";s:789:"Mas que una consulta es un reclamo:\r\nLos primeros días del mes me acerqué al consultorio, pase por entrevista y me dieron las pastillas , para mi y para mi amiga Janet Romero, pagué el valor de 550 por ambas por 2 semanas del tratamiento, lamentablemente solo lo hemos tomado 1 semana debido a que nos ha hecho daño a nuestra salud, hemos tenido ambas nauseas, agitación y fastidio estomacal, tenemos prácticamente todo el tramiento de la segunda semana, donde podemos reclamar para que nos hagan la devolución de nuestro dinero.\r\nEl año pasado tomamos el tratamiento y no nos hizo daño.\r\nQuedo atenta a su pronta respuesta, de lo contrario nos acercaríamos pro nuestra boleta y reclamo.\r\nAgradecemos la atención que le brinden a la presente.\r\nGracias.\r\nKarim Cajo\r\nJanet Romero";s:27:"contact_form_field_tel-fono";s:9:"966419854";s:12:"comment_type";s:12:"contact_form";s:7:"user_ip";s:15:"190.237.101.213";s:10:"user_agent";s:76:"Mozilla/5.0 (Windows NT 6.3; WOW64; Trident/7.0; MATBJS; rv:11.0) like Gecko";s:8:"referrer";s:40:"http://www.virgiliocuadros.com/contacto/";s:4:"blog";s:30:"http://www.virgiliocuadros.com";s:15:"SERVER_SOFTWARE";s:73:"Apache/2.2.29 (Unix) mod_ssl/2.2.29 OpenSSL/1.0.1e-fips mod_bwlimited/1.4";s:11:"REQUEST_URI";s:10:"/contacto/";s:16:"SERVER_SIGNATURE";s:0:"";s:15:"HTTP_USER_AGENT";s:76:"Mozilla/5.0 (Windows NT 6.3; WOW64; Trident/7.0; MATBJS; rv:11.0) like Gecko";s:11:"SERVER_PORT";s:2:"80";s:9:"HTTP_HOST";s:23:"www.virgiliocuadros.com";s:16:"REDIRECT_HANDLER";s:24:"application/x-httpd-php5";s:13:"DOCUMENT_ROOT";s:33:"/home/virgiliocuadros/public_html";s:15:"SCRIPT_FILENAME";s:43:"/home/virgiliocuadros/public_html/index.php";s: