(53, 1, '2013-04-09 19:48:37', '2013-04-09 19:48:37', 'Brindamos servicios profesionales a nivel nacional e internacional para el ciudado de la salud y belleza en forma integral.\r\n\r\n<strong>Nuestra Visión</strong>: ser una institución reconocida en la atención integral e investigación en el rubro de la belleza y salud a nivel nacional.\r\n\r\n<strong>Nuestros Valores</strong>:\r\n\r\n<em>Ética y Seguridad</em>: el paciente es atendido por profesionales capacitados en ambientes totalmente equipados para este tipo de cirugías.\r\n\r\n<em>Atención personalizada</em>: desde que el paciente es atendido por el doctor, se le hacen sus exámenes preoperatorios a la cirugía, para ser intervenido luego se le hace seguimiento vía telefónica para así saber el estado del paciente y fidelizarlo. Posteriormente, son necesarios sus controles con el doctor.', 'Nosotros', '', 'inherit', 'open', 'open', '', '9-revision-5', '', '', '2013-04-09 19:48:37', '2013-04-09 19:48:37', '', 9, 'http://www.virgiliocuadros.com/9-revision-5/', 0, 'revision', '', 0),
