(127, 1, '2013-04-10 19:52:44', '2013-04-10 19:52:44', '<img class="alignright size-full wp-image-55" alt="nosotros" src="http://www.virgiliocuadros.com/wp-content/uploads/2013/04/nosotros1.png" width="212" height="258" />Brindamos servicios profesionales a nivel nacional e internacional para el ciudado de la salud y belleza en forma integral.\r\n\r\n<strong>Nuestra Visión</strong>:\r\nser una institución reconocida en la atención integral e investigación en el rubro de la belleza y salud a nivel nacional.\r\n\r\n<strong>Nuestros Valores</strong>:\r\n\r\n<em>Ética y Seguridad</em>: el paciente es atendido por profesionales capacitados en ambientes totalmente equipados para este tipo de intervenciones.\r\n\r\n<em>Atención personalizada</em>: desde que el paciente es atendido por el doctor, se le hacen sus exámenes preoperatorios, para ser intervenido luego se le hace seguimiento vía telefónica para así saber el estado del paciente y fidelizarlo. Posteriormente, son necesarios sus controles con el doctor.', 'Nosotros', '', 'inherit', 'open', 'open', '', '9-revision-9', '', '', '2013-04-10 19:52:44', '2013-04-10 19:52:44', '', 9, 'http://www.virgiliocuadros.com/9-revision-9/', 0, 'revision', '', 0),
